車の中でも香りを楽しむカーフレグランス<br>フレグランスが香る、車の芳香剤。<br>エアコンの送風口に装着すると、風と共に香りに包まれます。<br><br>タバコや食べ物の気になる残り香に、車内の香り付けに香水級の本格フレグランスを。<br>オリジナルフレグランスボトルを再現し、ガラス製×メタリックで他にはない高級感を演出。<br><br>甘さと爽やかさをあわせ持った透明感のある「サムライ アクアマリン」の香り。<br><br>メーカー：SPRジャパン<style type="text/css">
